import React from 'react'
import classes from './Input.module.css';
import propTypes from 'prop-types';

const Input = ({ label }) => {
  return (
      <div className={classes.input}>
        <label>{label}</label>
        <input></input>
    </div>
  )
}

Input.propType = {
    label: propTypes.string
}

export default Input;
